function insertion_sort!(vector::AbstractVector)
    for i in 2 : length(vector)
        j = i - 1
        key = vector[i]
        while (j >= 1 && vector[j] > key)
            vector[j + 1] = vector[j]
            j -= 1
            vector[j + 1] = key
        end
    end
    return vector 
end

